$(function(){Array.prototype.getUnique=function(){return this.filter(function(x,i,a){return a.indexOf(x)==i})};$("tr[data-url]").click(function(evt){if($(evt.target).closest("a").length==0){window.location=$(this).data("url");return false}});$('[data-tab="tasks"] .toggle-closed-tasks').click(function(){$(this).closest("[data-tab]").find(".closed-task").show();$(this).hide();return false})});
